import React, { useEffect, useState } from 'react';
import Logo from '../assets/logo.png';
import './css/Navbar.css';
import { Link as RouterLink } from 'react-router-dom';  // For routing between pages
import { Link } from 'react-scroll';  // For smooth scrolling within the same page
import { useLocation } from 'react-router-dom';  // To check the current route

function Navbar() {
    const location = useLocation(); // Get current location/route
    const [isMenuOpen, setIsMenuOpen] = useState(false); // For toggling the mobile menu

    useEffect(() => {
        const handleScroll = () => {
            const header = document.querySelector(".App-header");
            if (header) {
                header.style.backgroundColor = window.scrollY > 0 ? "rgba(50, 50, 55, 0.5)" : "transparent";
                header.style.backdropFilter = window.scrollY > 0 ? "saturate(180%) blur(10px)" : "none";
                header.style.WebkitBackdropFilter = window.scrollY > 0 ? "blur(10px)" : "none";
            }
        };

        window.addEventListener("scroll", handleScroll);

        return () => {
            window.removeEventListener("scroll", handleScroll);
        };
    }, []);

    const handleRegisterClick = () => {
        // window.location.href = "https://forms.gle/Rs2B2QtocHNqWEuT6";
    };

    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);  // Toggle mobile menu
    };

    return (
        <div className="App-header">
            <div className="App-logo">
                {location.pathname === '/' && (
                    <Link to="homepage" smooth={true} duration={500} offset={-150}>
                        <img src={Logo} alt="Logo" width={200} />
                    </Link>
                )}
                {location.pathname !== '/' && (
                    <RouterLink to="/">
                        <img src={Logo} alt="Logo" width={200} />
                    </RouterLink>
                )}
            </div>

            {/* Hamburger Icon */}
            <div className="App-hamburger" onClick={toggleMenu}>
                <span className="hamburger-icon"></span>
                <span className="hamburger-icon"></span>
                <span className="hamburger-icon"></span>
            </div>

            {/* Menu */}
            <div className={`App-menu ${isMenuOpen ? 'open' : ''}`}>
                <ul>
                    {location.pathname === '/' && (
                        <>
                            <li><RouterLink to="/guidelines">Guidelines</RouterLink></li>
                            <li><RouterLink to="/domains">Problem Statements</RouterLink></li>
                            <li><RouterLink to="/campus-ambassador">CA</RouterLink></li>
                            <li><Link to="contact" smooth={true} duration={500} offset={-150}>Contact</Link></li>
                            <li><Link to="faq" smooth={true} duration={500} offset={-150}>FAQ</Link></li>
                        </>
                    )}
                    {location.pathname !== '/' && (
                        <>
                            <li><RouterLink to="/guidelines">Guidelines</RouterLink></li>
                            <li><RouterLink to="/domains">Problem Statements</RouterLink></li>
                            <li><RouterLink to="/campus-ambassador">CA</RouterLink></li>
                        </>
                    )}
                </ul>
            </div>

            <div className="App-Register">
                <button onClick={handleRegisterClick} className="animated-button">
                    <svg xmlns="http://www.w3.org/2000/svg" className="arr-2" viewBox="0 0 24 24">
                        <path
                            d="M16.1716 10.9999L10.8076 5.63589L12.2218 4.22168L20 11.9999L12.2218 19.778L10.8076 18.3638L16.1716 12.9999H4V10.9999H16.1716Z"
                        ></path>
                    </svg>
                    <span className="text">R E G I S T E R</span>
                    <svg xmlns="http://www.w3.org/2000/svg" className="arr-1" viewBox="0 0 24 24">
                        <path
                            d="M16.1716 10.9999L10.8076 5.63589L12.2218 4.22168L20 11.9999L12.2218 19.778L10.8076 18.3638L16.1716 12.9999H4V10.9999H16.1716Z"
                        ></path>
                    </svg>
                </button>
            </div>
        </div>
    );
}

export default Navbar;
